description:
Met behulp van deze patch heb ik de problemen omtrent 'nuttige plaatsen' van de Bakonl release van TomTom Navigator 5 verholpen. Althans van Benelux, andere landen heb ik nog niet kunnen testen.

-kopieer de bestanden naar je ppc 
-open(installeer) vanuit de ppc 'ttn.cab' file
Probleem opgelost!



With this patch I was able to fix the POI problem of Tomtom Navigator 5

-Copy the files to your ppc 
-open(instal) within the ppc the 'ttn.cab' file
Problem solved!


